import Input from "./components/inputs";
import Wrapper from "./components/wrapper";
import Header from "./components/header";

function App() {
  return (
    <div className="App">

      <Header></Header>
      <h1>DADOS P</h1>
      <Wrapper>
        <Input title="Nome"></Input>
        <Input title="E-mail"></Input>
        <Input title="CPF"></Input>
        <Input title="Data de Nascimento"></Input>
      </Wrapper>
    </div>
  );
}

export default App;
